CREATE TABLE `pagamento` (
  `pagamento_id` int NOT NULL AUTO_INCREMENT,
  `pagamento_forma` enum('CARTAO','BOLETO','PIX') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `pagamento_status` enum('PAGO','PROCESSANDO','CANCELADO','DEVOLVIDO','NEGADO') CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL,
  `usuario_id` int NOT NULL,
  `pagamento_valor_final` decimal(10,2) NOT NULL,
  `endereco_id` int NOT NULL,
  `pagamento_data` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `pagamento_parcelas` int DEFAULT '1',
  `pagamento_valor_parcela` decimal(10,2) DEFAULT NULL,
  PRIMARY KEY (`pagamento_id`),
  KEY `fk_pagamento_usuario` (`usuario_id`),
  KEY `fk_pagamento_endereco` (`endereco_id`),
  CONSTRAINT `fk_pagamento_endereco` FOREIGN KEY (`endereco_id`) REFERENCES `endereco` (`endereco_id`),
  CONSTRAINT `fk_pagamento_usuario` FOREIGN KEY (`usuario_id`) REFERENCES `usuario` (`usuario_id`)
